import React from "react";
import "./card-list.styles.css";

export const Cardlist = (props) => {
  return (
    <div className="card-list">
      {props.monster.map((monster) => (
        <h1 key={monster.id}>{monster.name}</h1>
      ))}
    </div>
  );
};
